import React from "react";
import {
  Navbar,
  Nav,
  NavDropdown,
  Button,
  Form,
  FormControl,
} from "react-bootstrap";

const NavBar = () => (
  <Navbar bg="light" expand="lg">
    <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="ml-auto">
        <Nav.Link className="ml-" href="#home">Blog</Nav.Link>
        <Nav.Link className="ml-" href="#link">Projects</Nav.Link>
        <Nav.Link className="ml-" href="#link">Contact</Nav.Link>
        <Nav.Link className="ml-" href="#link">Twitter Icon</Nav.Link>
        <Nav.Link className="ml-" href="#link">LinkedIn Icon</Nav.Link>
      </Nav>
    </Navbar.Collapse>
  </Navbar>
);

export default NavBar;
